-- ----------------------------
--  Table structure for `income`
-- ----------------------------
DROP TABLE IF EXISTS `income`;
CREATE TABLE `income` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `declaration_id` int(11) DEFAULT NULL,
  `owner` varchar(30) DEFAULT NULL,
  `amount` double DEFAULT NULL,
  `note` text,
  PRIMARY KEY (`id`),
  KEY `declaration_id` (`declaration_id`),
  CONSTRAINT `income_declaration_id` FOREIGN KEY (`declaration_id`) REFERENCES `declaration` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=625 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `income`
